function randint(a, b) {
	return Math.floor(Math.random() * (b - a) + a + 1e-6)
}
function toHex(x) {
	return x < 10 ? x.toString() : String.fromCharCode('a'.charCodeAt(0) + x - 10)
}
module.exports = () => {
	const arr = []
	var t = Number(new Date())
	for (let i = 0; i < 16; i++) {
		var tmp = t % 16
		arr.push(tmp)
		t = Math.floor((t - tmp) / 16 + 1e-6)
	}
	for (let i = 0; i < 16; i++)
		arr.push(randint(0, 16))
	var ans = ''
	for (let i = 0; i < 32; i++) {
		ans += toHex(arr[i])
		if (i == 7 || i == 11 || i == 15 || i == 19) ans += '-'
	}
	return ans
}